import React from 'react';
import '../css/IndProject.css';


class IndProject extends React.Component {
    render () {
        return (<>
            {this.props.workCarrier.forEach(val => {<div className="ind-project">
                <div className="ind-sub-div">
                    <div className="col-6">
                    </div>
                    <div className="col-6">
{val.title}
                    </div>
                </div>

                <hr className="col-11"></hr>
            </div>})};
            </>
        );
    }
}

export default IndProject;
